let tAccountLicenses,dataSet=null;$.ajax({url:"https://dashboard.8thsensus.com:8080/message",headers:{"Content-Type":"application/x-www-form-urlencoded"},type:"GET",dataType:"json",data:{},success:function(e){const n=window.location.search,t=new URLSearchParams(n).get("usrid");$("#userName").html(`<b>User</b>: ${t}`);let a="",r=alasql(`\n         SELECT customerid, machinename, devicelist, os, hardware, localip\n         FROM ?\n         WHERE userid = '${t}'\n         GROUP BY customerid, machinename, devicelist, os, hardware, localip\n         `,[e]);a+=`\n         <tr>\n            <td><b>Customer Id: </b> ${r[0].customerid}</td>\n         </tr>\n         <tr>\n            <td>\n               <b>Machine Name: </b> \n               <a href='machines.html?mchname=${r[0].machinename}'>\n                  ${r[0].machinename}\n               </a>\n            </td>\n         </tr>\n         <tr>\n            <td><b>Device List: </b> ${r[0].devicelist}</td>\n         </tr>\n         <tr>\n            <td><b>OS: </b> ${r[0].os}</td>\n         </tr>\n         <tr>\n            <td><b>Hardware: </b> ${r[0].hardware}</td>\n         </tr>\n         <tr>\n            <td><b>Local IP: </b> ${r[0].localip}</td>\n         </tr>\n      `,$("#usr-table tbody").append(a)},error:function(e,n,t){console.error(t)}});